
const env_width = 60;
const env_height = 80;
const render_zoom = 6;
const canvas_width = env_width * render_zoom;
const canvas_height = env_height * render_zoom;
const sight_percents = [-90, -60, -30, 0, 30, 60, 90];
const sight_range = 25;
const actor_y = 79;
const actor_diameter = 1;
const road_halfw = 12;
const max_road_change_dyn = 2;
const actor_speed = 2;

const straight_road_probab = 0.05;
const straight_road_max_len = 10;

// Reset with every episode
let actor_x;
let road = []; // same size as env_height, each item shows how far is the center of the road from the center of the environment
let rewardArray;

let brain;

function initBrain() {
	const num_inputs = sight_percents.length;
	const num_actions = 3;
	const temporal_window = 1; // amount of temporal memory. 0 = agent lives in-the-moment :)
	const network_size = num_inputs*temporal_window + num_actions*temporal_window + num_inputs;
	const layer_defs = [];
	layer_defs.push({type:'input', out_sx:1, out_sy:1, out_depth:network_size});
	layer_defs.push({type:'fc', num_neurons: 50, activation:'relu'});
	layer_defs.push({type:'fc', num_neurons: 50, activation:'relu'});
	layer_defs.push({type:'regression', num_neurons:num_actions});

	const tdtrainer_options = {learning_rate:0.001, momentum:0.0, batch_size:64, l2_decay:0.01};

	let opt = <any> {};
	opt.temporal_window = temporal_window;
	opt.experience_size = 30000;
	opt.start_learn_threshold = 1000;
	opt.gamma = 0.7;
	opt.learning_steps_total = 300000;
	opt.learning_steps_burnin = 3000;
	opt.epsilon_min = 0.05;
	opt.epsilon_test_time = 0.05;
	opt.layer_defs = layer_defs;
	opt.tdtrainer_options = tdtrainer_options;

	brain = new deepqlearn.Brain(num_inputs, num_actions, opt);
	brain.value_net.fromJSON(age305k);
}

// Setup for p5
function setup() {
	frameRate(150);
	createCanvas(canvas_width, canvas_height);
	initBrain();
	initEpisode();
}

function initEpisode() {
	initRoad();
	actor_x = env_width / 2;
	drawRoad();
	let sight = calculateSight();
	rewardArray = drawSight(sight);
	drawActor();
}

function initRoad(): number[] {
	for (let i = 0; i < env_height; i++) {
		road[i] = 0;
	}
	return road;
}


function newDynamic(): number {
	return Math.random() < 0.5 ?
		Math.floor((Math.random() * max_road_change_dyn) + 1) :
		Math.floor((Math.random() * max_road_change_dyn) - max_road_change_dyn);
}
let change_dynamic = newDynamic();
let go_straight = 0;

// Randomize road
function updateRoad() {
	let newHead;
	const oldHead = road[0];
	if (go_straight > 0) {
		//go straight
		newHead = oldHead;
		go_straight--;
	} else if (Math.random() < straight_road_probab) { 
		go_straight = Math.floor(Math.random() * straight_road_max_len) + 1;
		newHead = oldHead
	} else {
		const roadLeftSide = env_width / 2 + oldHead - road_halfw;
		const roadRigthSide = env_width / 2 + oldHead + road_halfw;
		if ((roadLeftSide + change_dynamic) < 0 || (roadRigthSide + change_dynamic) > env_width) {
			do {
				change_dynamic = newDynamic();
			} while (roadLeftSide + change_dynamic < 0 || roadRigthSide + change_dynamic > env_width);
		}
		newHead = oldHead + change_dynamic;
	}
	road = road.slice(0, 79);
	road.unshift(newHead);
}

function updateActorX(action: number) {
	if (action == 0) { // GO LEFT
		if (actor_x - actor_speed >= 0) {
			actor_x-=actor_speed;
		}
	} else if (action == 1) { // STAY
	} else if (action == 2) { // GO RIGHT
		if (actor_x + actor_speed <= env_width) {
			actor_x+=actor_speed;
		}
	}
}

// Draw called by p5
function draw() {
	var action = brain.forward(rewardArray);
	updateActorX(action);
	const r = reward();
	brain.backward(r);
	clear();
	if (r < 0) {
		initEpisode();
	} else {
		drawRoad();
		rewardArray = calculateSight();
		drawSight(rewardArray);
		drawActor();
		updateRoad();
	}

	text("Age:" + brain.age, 5, 15);
	text("Learning:" + brain.learning, 5, 35);
}

let running = true;

function keyPressed() {
	if (keyCode == 32) { // space
		if (running) {
			noLoop();
			running = false;
		} else {
			loop();
			running = true;
		}
	}
	// if (keyCode == 37) { // left
	// 	updateActorX(0);
	// } else if (keyCode == 39) { // right
	// 	updateActorX(2)
	// }
}



function reward(): number {
	const roadLeftSide = env_width / 2 + road[actor_y] - road_halfw;
	const roadRigthSide = env_width / 2 + road[actor_y] + road_halfw;
	if (actor_x <= roadLeftSide || actor_x >= roadRigthSide) {
		return -10;
	} else {
		return 1;
	}
}

function drawLine(x1: number, y1: number, x2: number, y2: number) {
	line(
		x1 * render_zoom,
		y1 * render_zoom,
		x2 * render_zoom,
		y2 * render_zoom);
}

function drawRect(x1: number, y1: number, x2: number, y2: number) {
	rect(
		x1 * render_zoom,
		y1 * render_zoom,
		x2 * render_zoom,
		y2 * render_zoom);
}

function drawActor() {
	stroke(color(0, 0, 0));
	ellipse(
		actor_x * render_zoom,
		actor_y * render_zoom,
		actor_diameter * render_zoom,
		actor_diameter * render_zoom);
}

function drawRoad() {
	road.forEach(function(rd_center, index) {
		const center = env_width/2 + rd_center;
		stroke(color(211, 211, 211));
		fill(color(211, 211, 211));
		drawRect(center - road_halfw, index, 2 * road_halfw, 1);
	});
}

function toRadian(degrees: number): number {
  return degrees * Math.PI / 180;
}

function calculateSight(): number[] {
	const ranges = sight_percents.map(function(p){
		let range;
		for (range = actor_diameter; range <= sight_range; range++) {
			let possible_x = Math.round(Math.sin(toRadian(p)) * range);
			let possible_y = Math.round(Math.cos(toRadian(p)) * range);
			const roadLeftSide = env_width / 2 + road[actor_y - possible_y] - road_halfw;
			const roadRigthSide = env_width / 2 + road[actor_y - possible_y] + road_halfw;
			if (roadLeftSide > actor_x + possible_x || roadRigthSide < actor_x + possible_x) {
				break;
			}

		}
		return range - 1;
	});
	return ranges;
}

function drawSight(ranges: number[]) {
	ranges.forEach(function(r, index) {
		if (r > 1) {
			let sight_x = Math.round(Math.sin(toRadian(sight_percents[index])) * r);
			let sight_y = Math.round(Math.cos(toRadian(sight_percents[index])) * r);
			const green = r * 10;
			const red = 255 - green;
			stroke(color(red, green, 150));
			drawLine(actor_x, actor_y, actor_x + sight_x, actor_y - sight_y);
		}
	});
}

